const styles = {

    button: {
        backgroundColor: '#ff007f',
        height: 60,
        flexDirection: 'row',
        overflow: 'hidden',
        alignItems: 'center',
        maxWidth: 350,
        marginLeft: 10,
        padding: 8,
        marginTop: 0,
        marginBottom: 20,
    },

    buttonText: {
        flex: 1,
        justifyContent: 'center',
        textAlign: 'center',
        color: '#FFF',
        fontFamily: 'Roboto_500Medium',
        fontSize: 16,
    },

    container: {
        backgroundColor: '#F0F0F5',
        alignItems: 'center',
        flex: 1,
        justifyContent: 'center',
    },

    editor: {
        marginLeft: 350
    },

    image: {
        borderWidth: 1,
        borderColor: 'black',
        borderRadius: 100,
        width: 200,
        height: 200,
        overflow: 'hidden',
        alignSelf: 'center',
    },

    input: {
        backgroundColor: "white",
        borderRadius: 25,
        maxWidth: 350,
        marginLeft: 10,
        padding: 8,
        marginTop: 0,
        marginBottom: 20,
    },

    inputDesc: {
        backgroundColor: '#fff',
        borderRadius: 25,
        maxWidth: 350,
        marginLeft: 10,
        height: 120,
        paddingHorizontal: 10,
        paddingVertical: 10,
        marginTop: 0,
        marginBottom: 70,
    },

    text: {
        marginLeft: 14,
        fontSize: 20
    },

    title: {
        color: '#322153',
        fontSize: 20,
        fontFamily: 'Ubuntu_700Bold',
        maxWidth: 260,
        textAlign: 'center',
        marginVertical: 10,
    },

    view: {
        marginTop: 10,
    },
}

export default styles;
